import React from "react";
import { MovieCard } from "../../components/MovieCard";
import { movies } from "../../constants/moviesMock";

const Home = () => {
  return (
    <div className="grid grid-cols-1 mx-1">
      <h1 className="text-3xl text-gray-800 font-semibold my-6 mx-12">POPULAR</h1>
        <div className='snap-x overscroll-auto flex -space-x-5'>
          {movies.map((movie, index) => (
            <div className="snap-start" key={index}>
              <MovieCard
                title={movie.title}
                genreId={movie.genre_ids[0]}
                movieId={movie.id}
                voteAverage={movie.vote_average}
                posterPath={movie.poster_path}
              />
            </div>
          ))}
        </div>
        <h1 className="text-3xl text-gray-800 font-semibold my-6 mx-12">TOP RATED</h1>
        <h1 className="text-3xl text-gray-800 font-semibold my-6 mx-12">NOW PLAYING</h1>
      </div>   
  );
}

export default Home;
